function App() {
  const handlePrint = () => {
    window.print()
  }
  return (
    <>
      <main>
          <header>
            <div>
              <h2>Facturation</h2>
            </div>
            <div>
              <ul>
                <li><button onClick={handlePrint}>Imprimer </button></li>
                <li>Installé</li>
                <li>Envoyer</li>
              </ul>
            </div>
          </header>
          {/* End of header */}

          {/* Your details */}
          <section>
            <input type="text" name="text" id="text"
            placeholder="Enter your name" required />
            <h2>Oumaima</h2>
            <p>Your Adress</p>
         </section>
          {/* End of your details */}

          {/* Client details */}
          <section>
            <h2>Client's Name</h2>
            <p>Client's adress</p>
          </section>
          {/* End of client details */}

          {/* Dates */}
          <article>
            <ul>
              <li>Numero de facturation</li>
              <li>Date du facturation</li>
              <li>Date d'échéance</li>
            </ul>
          </article>

          {/* End of dates */}





      </main>
    </>
  );
}

export default App;
